import React from "react";

function Nav() {
    return (
        <nav className="navbar navbar-light bg-light">
            <span className="navbar-brand mb-0 h1">Employee Directory</span>
            <span className="navbar-text">Click on carrots to filter or use the search boxto narrowyour results</span>
        </nav>
    );
}

export default Nav;
